import React, { Component } from 'react';

//import './App.css';



class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      currentTodo: '',
      todos: []
    };
  }


  render() {

    return (
        <div>
            <form>
              <input value={this.state.currentTodo} />
              <button>VAI!</button>
            </form>
        </div>

    );
  }
}



export default App;
